import { useRouter } from 'next/router';

const FoodDetailsPage = () => {
  const router = useRouter();
  const fdcId = router.query.id;
  const FoodData = JSON.parse(localStorage.getItem('FoodData'));
  console.log("data in detailed page", FoodData.data.foods);
  for(let [key, value] of Object.entries(FoodData.data.foods)){
    //console.log(`${key}-${value.fdcId}`);
    if(fdcId == Number(value.fdcId)){
      console.log(fdcId);
      console.log("Number: ", Number(value.fdcId))
    }
  }

  return (
    <div>
      <h3>{fdcId}</h3>
      {/* 
      <p>{ foods && foods.ingredients }</p>
      <ul>
        { foods &&
          foods.foodNutrients.map((nutrient) => (
            <li key={nutrient.nutrientId}>{nutrient.nutrientId}</li>
          )) }
      </ul>
      */}
    </div>
  );
};
  

export default FoodDetailsPage;
